import React from 'react'
import './ToduList.css'

function ToduList() {
  const todosSample = [
    {id:1 , todo:"todo1" , complete:true},
    {id:2 , todo:"todo2" , complete:false},
    {id:3 , todo:"todo3" , complete:true},
    {id:4 , todo:"todo4" , complete:false}
  ]
  
  function isCompleted(item){
    return item.complete === true? "#28a745" : "transparent";
  }
  return (
    <div className='ToduList'>
      <table>
        {todosSample.map((item , index)=>{
          return(
            <div className='tableCondainer' key={item.id} style={{backgroundColor:isCompleted(item)}}>
              <tr>
                <td><input type="checkbox" id={item.id} name={item.todo} value={true} /></td>
                <td className='t'>{item.todo}</td>
                <td><button>Delete</button></td>
              </tr>
            </div>)
        })}
      </table>
    </div>
  )
}

export default ToduList
